import React, { Component } from 'react';

class Header extends Component {
	render() {
		return (
			<div className="navbar bg-dark rounded ">
				<div className="container">
					<a href="#" className="logo">
						logo
					</a>

					<ul>
						<a href="/">HOME</a>
						<a href="/Team">Team</a>
						<a href="/Project">OurProject</a>
					</ul>
				</div>
			</div>
		);
	}
}
export default Header;
